import React, { useState, useEffect } from 'react';
import {NavigationContainer} from '@react-navigation/native';
import {createStackNavigator} from '@react-navigation/stack';
import { StyleSheet, Text, View, Image, Platform } from 'react-native';
import { withAuthenticator } from 'aws-amplify-react-native'
import Dashboard from './src/Dashboard';
import Perimiter from './src/Perimiter';
import MyLocation from './src/MyLocation';
import MyMaps from './src/MyMaps';
import MapScreen from './src/MapScreen';
import { Amplify } from 'aws-amplify';
import awsconfig from './src/aws-exports';

Amplify.configure({
  ...awsconfig,
  Analytics: {
    disabled: true,
  },
});

import { LogBox } from 'react-native';
LogBox.ignoreLogs(['Setting a timer']);

const Stack = createStackNavigator();

class App extends React.Component {
  render () {
    return (
      <NavigationContainer>
        <Stack.Navigator>
          <Stack.Screen name='Dashboard' component={Dashboard} options={{ headerShown: true }}/>
          <Stack.Screen name='Perimiter' component={Perimiter} options={{ headerShown: true }}/>
          <Stack.Screen name='MyMaps' component={MyMaps} options={{ headerShown: true }}/>
          <Stack.Screen name='MyLocation' component={MyLocation} options={{ headerShown: true }}/>
          <Stack.Screen name='MapScreen' component={MapScreen} options={{ headerShown: true }}/>
         </Stack.Navigator>
      </NavigationContainer>
    );
  }
};

 export default withAuthenticator(App, { 
    includeGreetings: true,
    });

const styles = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center',
    marginTop: 50,
    padding: 16,
  },
  boldText: {
    fontSize: 30,
    color: 'red',
  },
});
